  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Snake Creek National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1961.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  fish, and reptiles- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, and vegetation control. Resource management
  is outlined; topics include grazing and haying. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, and violations.
  Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
